import React from 'react'
const Help = () => {
    return(
        <div className="container">
            <h4 className="left">Help</h4>
            <Form>
                <Form.Group controlId="exampleForm.ControlTextarea1">
                <Form.Label>Example textarea</Form.Label>
                <Form.Control as="textarea" rows="3" />
                </Form.Group>
            </Form>
        </div>
    )
}

export default Help;
